import "./Home.css";

export default function Home() {
  return (
    <div class="container">
      <h1 class="title">MENU'S WORLD</h1>
      <h2 class="subtitle">Hola</h2>
      <p>
        Bienvenido a la pgina que busca mejorar tu experiencia digital de
        consulta de menus. Puedes elegir registrarte o ir directamente a ver los
        menu
      </p>

      <button type="button" class="button search-meal">
        {" "}
        Buscar un platillo
      </button>

      <button type="button" class="button register">
        {" "}
        Registrarme
      </button>
    </div>
  );
}
